import Layout from '../components/Layout';

const Contact = () => (
  <Layout>
    <div>
      <h1>Contact</h1>
      <p>Nayab Lone 
          Email: Nayab.Lone@hyperisland.se<hr></hr>
          Phone : 0738236700
          Facebook: Ryangigs
      </p>
    </div>
  </Layout>
);

export default Contact;
